  false,\n\t\"url\": null,\n\t\"notes\": \"This letter is recommendations, from the
  Northern Prairie Wildlife Research Center, are from a site visit to Bowdoin National
  Wildlife Refuge (NWR) to discuss water management.  Bowdoin NWR is developing a
  plan to store irrigation water in refuge pools to enhance the ability to manage
  the refuge for migratory birds. This letter offers recommendations to aid in the
  facilitation of such a plan.  Topics covered include salt management, botulism risk
  management, and lake management.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
